              </div>
              <div className="form-field">
                <label htmlFor="birthCountry">
                {translations[language].birthCountry}
                </label>
                <br />
                <input
                  name="birthCountry"
                  type="text"
                  id="birthCountry"
                  list="countries"
                  value={birthCountry}
                  onChange={handleBirthCountryChange}
                />
                <br />
              </div>
              <div className="form-field">
                <label htmlFor="countryResidence">
                {translations[language].countryResidence}
                </label>
                <br />
                <input
                  name="countryResidence"
                  type="text"
                  id="countryResidence"
                  list="countries"
                  value={countryResidence}
                  onChange={handleCountryResidenceChange}
                />
                <br />
              </div>
              <div className="form-field">
                <label htmlFor="residencePlace">
                {translations[language].residencePlace}
                </label>
                <br />
                <input
                  name="residencePlace"
                  type="text"
                  id="residencePlace"
                  maxLength={50}
                  value={residencePlace}
                  onChange={handleResidencePlaceChange}
                  list={showCities ? "cities" : ""}
                />
                <datalist id="cities">
                  {citiesOfCroatia.map((city, index) => (
                    <option key={index} value={city.city} />
                  ))}
                </datalist>
              </div>
              <div className="form-field">
                <label>Document type / Vrsta isprave</label>
                <br />
                <select
                  name="documentType"
                  id="documentType"
                  value={documentType}
                  onChange={handleDocumentTypeChange}
                >
                  <option value="ID">ID</option>
                  <option value="Passport">Passport</option>
                  <option value="DrivingLicense">Driving license</option>
                  <option value="HealthCard">Health Insurance Card</option>
                </select>
                <br />
              </div>
              <div className="form-field">
                <label htmlFor="documentNumber">
                  Document number / Broj isprave
                </label>
                <br />
                <input
                  name="documentNumber"
                  type="text"
                  id="documentNumber"
                  maxLength={16}
                  value={documentNumber}
                  onChange={handleDocumentNumberChange}
                  style={getValidationStyle(documentNumber)}
                />
                <br />
              </div>
              <p className="addNext">
                <button id="addNextPersonButton" className="add-person-btn">
                  ADD NEXT PERSON
                </button>
              </p>
            </div>
            <div id="second-person"></div>
            <div id="third-person"></div>
            <div id="fourth-person"></div>
            <div id="fifth-person"></div>
          </div>
          <div
            className="checkbox-class checkbox-div"
            style={{ marginBottom: "60px" }}
          >
            <label htmlFor="checkbox-check">
              <input
                type="checkbox"
                name="checkForm"
                id="checkbox-check"
                value={acceptGDPR}
                onChange={handleGDPRCheckbox}
              />
              <span className="text-accept">
                {" "}
                I accept the{" "}
                <a
                  href="https://mvisitor.hr/tz/gdpr/GDPR_EN.pdf"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  GDPR{" "}
                </a>
                and{" "}
                <a
                  href="https://intersoft.uno/izjava-o-privatnosti.html"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  privacy policy
                </a>
              </span>
            </label>
          </div>

          <p className="check-in-btn">
            <button id="submit" className="submit-btn" type="submit">
              CHECK-IN
            </button>
          </p>
        </form>
      </div>
    </div>
  );
}

export default Form;
